import React from 'react';

function Travel() {
  return (
    <div className="landing_page">
      <h1>Travel</h1>
      <hr></hr>
      <h2> How to get Nha Trang from USA</h2>

      <p> The easiest way is to take direct flight from San Francisco to Ho Chi Minh city and then take domestic flight to Nha Trang.</p>
    </div>
  );
}

export default Travel;
